def get_sol(): return Solution()

class Solution:
    def hIndex(self, citations: List[int]) -> int:
        n = len(citations)
        left,right = 0,n-1
        while left<=right:
            mid=(left+right)//2
            cnt=n-mid
            # if citations[mid]==cnt: # even if we have duplicates it works. eg 1,2,3,3,3,3,3,4,5
            #     return cnt
            if citations[mid]<cnt:
                left=mid+1
            else:
                right=mid-1
        return n-left # After iteration, it is guaranteed that left is the one we need to find (i.e. len-left papars have at least len-left citations)
class Solution2:
    def hIndex(self, citations: List[int]) -> int:
        n=len(citations)
        if n==0: return 0
        lo=0
        hi=citations[-1]
        while lo<=hi:
            m=(lo+hi)//2
            cnt=n-bisect_left(citations,m)
            if cnt>=m:
                lo=m+1
            else:
                hi=m-1
        return lo-1

